import React from "react";
import Images2016 from "./Images2016";
import { Route } from "react-router-dom";

export default function routes2016() {
  let routes = Images2016.map((image) => {
    <Route exact path={"/feed" + image.src}>
      <div className="d-flex justify-content-center mt-4">
        <img
          className="img-fluid"
          src={image.src}
          alt={image.title}
          style={{
            maxHeight: "92vh",
            objectFit: "contain",
          }}
        ></img>
      </div>
    </Route>;
  });
  return routes;
}
